import "./StudentPendingOutpasses.css"

const StudentPendingOutpasses = () => {
    return(
        <div className="s-pending">
            <div className="bimage"></div>
            <div className="s-pending-info">
                <h1>Find your outpasses pending </h1>
            </div>
            <div className="s-home-container">
                
            </div>
        </div>
    )
}

export default StudentPendingOutpasses
